import React from 'react'
import JoinSpace from './JoinSpace'
import '../assets/css/Container.css'


const Cointainer = () => {
    return (
        <div class="container">
            <div class="col-2"></div>
            <div class="col-6 border">
                <JoinSpace />
            </div>
            <div class="col-4"></div>
        </div>
    );
}

export default Cointainer;
